import React from 'react'
import  {FaGithub} from 'react-icons/fa'

function Navbar() {
  return 
  <nav className='navbar mb-12 shadow-lg bg-neutral'>Navbar
  </nav>

}

Navbar.defaultProps ={
title: 'Github Finder'
}

Navbar.propTypes ={
title: PropTypes.string,
}




export default Navbar
